import React from 'react';

import './Customer.css';

class CustomerData {
	id!: number;
	name!: string;
	phoneNumber!: string;

    constructor(id: number, name: string, phoneNumber: string) {
        this.id = id;
        this.name = name;
        this.phoneNumber = phoneNumber;
    }
}

const users = [
    new CustomerData(1, "banj", "3028424324"),
    new CustomerData(1, "banawdja", "3324424324"),
    new CustomerData(1, "banja", "333435678"),
];

const Customer = () => {
	return (
		<section>
			<div className='how'>
                {users.map((user) => (<div><span>Ten: </span></div>))}
			</div>
		</section>
	);
};

export default Customer;
